DELIMITER $$
CREATE TRIGGER `addLeaves` AFTER INSERT ON `employee` FOR EACH ROW BEGIN

DECLARE casual_ INTEGER;
DECLARE medical_ INTEGER;
DECLARE short_ INTEGER;
DECLARE half_ INTEGER;

SELECT `casualLeaves`, `sickLeaves`, `shortLeaves`, `halfdays` INTO @casual_,@medical_,@short_,@half_ FROM `employeesalarydetails` WHERE type = NEW.jobRole;

INSERT into leavesremaining values(NEW.employeeNo,@casual_,@medical_,@short_,@half_);
END
$$
DELIMITER ;

